import React, { useState } from 'react';
import { Button } from 'primereact/button';
import { InputText } from 'primereact/inputtext';
import { Menubar } from 'primereact/menubar';
import { Avatar } from 'primereact/avatar';
import { Badge } from 'primereact/badge';
import { Divider } from 'primereact/divider';

const HeaderComponent = () => {
  const [searchValue, setSearchValue] = useState('');

  // Menu items for the header navigation
  const menuItems = [
    {
      label: 'Home',
      icon: 'pi pi-home',
      url: '/'
    },
    {
      label: 'Products',
      icon: 'pi pi-box',
      items: [
        {
          label: 'All Products',
          icon: 'pi pi-list',
          url: '/products'
        },
        {
          label: 'Categories',
          icon: 'pi pi-tags',
          url: '/categories'
        },
        {
          label: 'New Arrivals',
          icon: 'pi pi-star',
          url: '/new-arrivals'
        }
      ]
    },
    {
      label: 'About',
      icon: 'pi pi-info-circle',
      url: '/about'
    },
    {
      label: 'Contact',
      icon: 'pi pi-envelope',
      url: '/contact'
    }
  ];

  // Right side menu items (user actions)
  const endItems = [
    {
      label: (
        <div className="flex align-items-center gap-2">
          <i className="pi pi-search"></i>
          <InputText
            placeholder="Search..."
            value={searchValue}
            onChange={(e) => setSearchValue(e.target.value)}
            className="p-inputtext-sm"
            style={{ width: '200px' }}
          />
        </div>
      ),
      className: 'p-menuitem-link'
    },
    {
      label: (
        <Button
          icon="pi pi-heart"
          severity="secondary"
          text
          badge="3"
          badgeClassName="p-badge-danger"
        />
      ),
      className: 'p-menuitem-link'
    },
    {
      label: (
        <Button
          icon="pi pi-shopping-cart"
          severity="secondary"
          text
          badge="5"
          badgeClassName="p-badge-warning"
        />
      ),
      className: 'p-menuitem-link'
    },
    {
      label: (
        <div className="flex align-items-center gap-2">
          <Avatar
            image="https://via.placeholder.com/32x32"
            shape="circle"
            size="normal"
          />
          <span className="font-medium">John Doe</span>
          <i className="pi pi-chevron-down text-xs"></i>
        </div>
      ),
      items: [
        {
          label: 'Profile',
          icon: 'pi pi-user',
          url: '/profile'
        },
        {
          label: 'Settings',
          icon: 'pi pi-cog',
          url: '/settings'
        },
        {
          separator: true
        },
        {
          label: 'Logout',
          icon: 'pi pi-sign-out',
          url: '/logout'
        }
      ]
    }
  ];

  return (
    <div className="header-component">
      {/* Top bar with contact info and social links */}
      <div className="bg-primary text-white p-2">
        <div className="flex justify-content-between align-items-center">
          <div className="flex align-items-center gap-4 text-sm">
            <span className="flex align-items-center gap-1">
              <i className="pi pi-phone"></i>
              +1 (555) 123-4567
            </span>
            <span className="flex align-items-center gap-1">
              <i className="pi pi-envelope"></i>
              info@company.com
            </span>
          </div>
          <div className="flex align-items-center gap-2">
            <Button
              icon="pi pi-facebook"
              text
              className="p-button-text-white"
              size="small"
            />
            <Button
              icon="pi pi-twitter"
              text
              className="p-button-text-white"
              size="small"
            />
            <Button
              icon="pi pi-instagram"
              text
              className="p-button-text-white"
              size="small"
            />
          </div>
        </div>
      </div>

      {/* Main header with logo, navigation, and user actions */}
      <div className="bg-white shadow-1 p-3">
        <div className="flex justify-content-between align-items-center">
          {/* Logo */}
          <div className="flex align-items-center gap-3">
            <div className="bg-primary text-white p-2 border-round font-bold text-xl">
              LOGO
            </div>
            <span className="text-xl font-bold text-900">Company Name</span>
          </div>

          {/* Main navigation */}
          <Menubar
            model={menuItems}
            className="border-none bg-transparent"
            style={{ minHeight: 'auto' }}
          />

          {/* User actions */}
          <div className="flex align-items-center gap-3">
            <InputText
              placeholder="Search..."
              value={searchValue}
              onChange={(e) => setSearchValue(e.target.value)}
              className="p-inputtext-sm"
              style={{ width: '180px' }}
            />

            <Button
              icon="pi pi-heart"
              severity="secondary"
              text
              badge="3"
              badgeClassName="p-badge-danger"
            />

            <Button
              icon="pi pi-shopping-cart"
              severity="secondary"
              text
              badge="5"
              badgeClassName="p-badge-warning"
            />

            <Divider layout="vertical" />

            <div className="flex align-items-center gap-2 cursor-pointer">
              <Avatar
                image="https://via.placeholder.com/32x32"
                shape="circle"
                size="normal"
              />
              <span className="font-medium">John Doe</span>
              <i className="pi pi-chevron-down text-xs"></i>
            </div>
          </div>
        </div>
      </div>

      {/* Secondary navigation bar (optional) */}
      <div className="bg-gray-50 p-2 border-top-1 border-gray-200">
        <div className="flex justify-content-center">
          <div className="flex gap-4 text-sm">
            <a href="/deals" className="text-primary font-medium hover:text-primary-600">
              🎉 Special Deals
            </a>
            <a href="/new" className="text-primary font-medium hover:text-primary-600">
              ✨ New Arrivals
            </a>
            <a href="/sale" className="text-primary font-medium hover:text-primary-600">
              🔥 Sale Items
            </a>
            <a href="/support" className="text-primary font-medium hover:text-primary-600">
              💬 Live Support
            </a>
          </div>
        </div>
      </div>
    </div>
  );
};

export default HeaderComponent;
